import React from 'react';
import './App.css';
import { Input, Button, Form, List, Avatar } from 'antd';
import { EditFilled, DeleteOutlined } from '@ant-design/icons';

const links = [
  'Rooms',
  'Bookings',
  'Visitors'
]
function App() {
  return (
    <div className="App">
      <header />
      <nav>
        <div>
          {links.map((link) => (
            <NavLink className="headerLink" key={link} to={link}>
              {link}
            </NavLink>
          ))}
        </div>
      </nav>
    </div>
  );
}

export default App;
